      SELECT + col0 * - ( - 59 * col0 ) AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - col0 / - col2 BETWEEN 6 * + col0 - 60 AND ( - 57 + col1 );
  - name: tab0

